\\\"Riders on the Storm\\\" from the album 'L.A. Woman'.\\n\\n📺 Watch more The Doors videos here https://bit.ly/TheDoorsYT\\n\\n🆕 The latest from The Doors https://linktr.ee/thedoors\\n\\n🔔 Subscribe to The Doors channel and ring the bell to turn on notifications https://bit.ly/SubscibetoTheDoors\\n\\n🔊 Listen to The Doors https://thedoors.lnk.to/TheDoorsSTR\\n\\nStay in touch with The Doors…\\n\\n🌐 Website https://thedoors.com\\n📣 Facebook https://www.facebook.com/thedoors\\n📸 Instagram https://www.instagram.com/thedoors\\n⌨ Twitter https://twitter.com/thedoors\\n\\n*******************\\n\\nThe Doors channel is the official YouTube home of classic Doors live performances, The Doors albums, and contemporary performances and content honoring The Doors featuring John Densmore and Robby Krieger. \\n\\nWith an intoxicating, genre-blending sound, provocative and uncompromising songs, and the mesmerizing power of singer Jim Morrison’s poetry and presence, The Doors had a transformative impact not only on popular music but on popular culture.\\n\\nThe Doors’ arrival on the rock scene in 1967 marked not only the start of a string of hit singles and albums that would become classics, but also of something much bigger – a new and deeper relationship between creators and audience. Refusing to be mere entertainers, the Los Angeles quartet relentlessly challenged, confronted and inspired their fans, leaping headfirst into the heart of darkness while other bands warbled about peace and love. Though they’ve had scores of imitators, there’s never been another band quite like them.\"},\"lengthSeconds\":\"436\",\"ownerProfileUrl\":\"http://www.youtube.com/@thedoors\",\"externalChannelId\":\"UCYgJ2M1mq8Ae0QOm_VQU4VQ\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\ oors channel is the official YouTube home of classic Doors live performances, The Doors albums, and contemporary performances and content honoring The Doors featuring John Densmore and Robby Krieger. \\n\\nWith an intoxicating, genre-blending sound, provocative and uncompromising songs, and the mesmerizing power of singer Jim Morrison’s poetry and presence, The Doors had a transformative impact not only on popular music but on popular culture.\\n\\nThe Doors’ arrival on the rock scene in 1967 marked not only the start of a string of hit singles and albums that would become classics, but also of something much bigger – a new and deeper relationship between creators and audience. Refusing to be mere entertainers, the Los Angeles quartet relentlessly challenged, confronted and inspired their fans, leaping headfirst into the heart of darkness while other bands warbled about peace and love. Though they’ve had scores of imitators, there’s never been another band quite like them.\",\"commandRuns\":[{\"startIndex\":143,\"length\":25,\"onTap\":{\"innertubeCommand\":{\"clickTrackingParams\":\"CN8CEM2rARgBIhMImvPehIzBhAMVLsY0Bx2z1geSSJ_HvcvPwu-27AE=\",\"commandMetadata\":{\"webCommandMetadata\":{\"url\":\"https://www.youtube.com/redirect?event=video_description\\u0026redir_token=QUFFLUhqbXk1ZWREZ3lxdEJiajg2bkYwMWV6U0N6LV9iUXxBQ3Jtc0tuZ29ZdkhnSGVzYTVfSzVJbFlXRmtIa3JzYWR0MGdwNUZnUUhBcmhyclRMSkpkZXZiUlY4aGs4bjI3STVkdWhPdmNJN0x5eHo5dC1wVHc5ZTJ4NzJlRUlEbG1saW1VSk8ycXVjQ1EyRXdIeV9yVnoxaw\\u0026q=https%3A%2F%2Fbit.ly%2FTheDoorsYT\\u0026v=7G2-FPlvY58\",\"webPageType\":\"WEB_PAGE_TYPE_UNKNOWN\",\"rootVe\":83769}},\"urlEndpoint\":{\"url\":\"https://www.youtube.com/redirect?event=video_description\\u0026redir_token=QUFFLUhqbXk1ZWREZ3lxdEJiajg2bkYwMWV6U0N6LV9iUXxBQ3Jtc0tuZ29ZdkhnSGVzYTVfSzVJbFlXRmtIa3JzYWR0MGdwNUZnUUhBcmhyclRMSkpkZXZiUlY4aGs4bjI3STVkdWhPdmNJN0x5eHo5dC1wVHc5ZTJ4NzJlRUlEbG1saW1VSk8ycXVjQ1EyRXdIeV9yVnoxaw\\u0026q=https%3A%2F%2Fbit.ly%2FTheDoorsYT\\u0026v=7G2-FPlvY58\",\"targ
